import React from 'react';
import { Segment, Image, Grid, GridColumn } from 'semantic-ui-react';
import onlineResume from './assets/teal/undraw_online_resume.png';
import journey from './assets/teal/undraw_journey.png';
import escaping from './assets/teal/undraw_escaping.png';


const Home = () => {
    return (
        <Segment color='teal' padded='very'>
            <Grid divided columns={2}>
                <GridColumn>
                    <Image src={onlineResume} />
                </GridColumn>
                <GridColumn>

                </GridColumn>
            </Grid>
            <Grid divided columns={2}>
                <GridColumn>

                </GridColumn>
                <GridColumn>
                    <Image src={journey} />=
                </GridColumn>
            </Grid>
            <Grid divided columns={2}>
                <GridColumn>
                    <Image src={onlineResume} />
                </GridColumn>
                <GridColumn>

                </GridColumn>
            </Grid>
        </Segment>
    )
}

export default Home;
